import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AppRoutes from "../../utils/app-routes";
import AfterScan from "../../pages/shared/after-scan";

const Stack = createNativeStackNavigator();

const SharedScreens = [
    <Stack.Screen key={'s1'} name={AppRoutes.SharedScreens.AfterScan.name} component={AfterScan} options={{ headerShown: false }} />,
]

export default SharedScreens;
